 class User extends React.Component {
    users = [
        {
            id: 1,
            name: "vasay"
        },
        {
            id: 2,
            name: "миша"
        }
     ]
    render() {
    return (<div>
     this.users.map((el) => {
      <h1>el.name</h1>
    })


    </div>)
    }
 }


 export default User
